import { useState } from "react";

function LoginPage() {

    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    /** Arrow functions to handle authentication */
    const handleUsername = (event) => {
        setUsername(event.target.value);
    }
    const handlePassword = (event) => {
        setPassword(event.target.value);
    }
    
    return(
        <div>
            <h1>Login Page</h1>
            <div className="login-container">
                <div className="login-container-login">
                    <h2>Sign in</h2>
                    <input
                        type="text"
                        placeholder="Username"
                        value={username}
                        onChange={handleUsername} //need to write handleUsername function
                    />
                    <br/>
                    <input
                        type="password"
                        placeholder="Password"
                        value={password}
                        onChange={handlePassword} //need to write handlePassword function
                    />
                    <br/>
                    <input
                        type="button"
                        value="Sign In"
                        //need to write handleLogin function and add onClick={handleLogin}
                    />
                </div>
                <p>Don't have an account? Sign up here:</p>
                <div className="login-container-signup">
                    
                </div>
            </div>
        </div>
    )
    
}

export default LoginPage;
